(function() {
	$('.anchor').on('click', function(e) {
		var id = $(this).attr('href')
		$('html, body').stop().animate({
			scrollTop: $(id).offset().top - $('#header').height()
		}, 400);
		e.preventDefault();
	});
})();

(function() {	
	wow = new WOW({
		offset: 100,
		live: false,
		mobile: false,
		resetAnimation: false
    });
	wow.init();

	$('body').on('click', '.open-nav', function () {
		$('.header__burger').toggleClass('active');
		$('.header__mobi-nav').toggleClass('active');
	});

	$('body').on('click', '.open-city', function () {
		$('.header__city-choose_wrap').toggleClass('active');
		$('body').toggleClass('disable-scroll');
		$('.header__mobi-nav').removeClass('active');
	});

	$('body').on('click', '.open-select', function () {
		$('.select_wrap').toggleClass('active');
	});

	$('body').on('click','.open-lang', function () {
		$(this).toggleClass('active');
	});

	if($(window).width() > 969) {
		$('body').on('mouseenter','.open-lang', function () {
			$(this).addClass('active');
		});

		$('body').on('mouseleave','.open-lang', function () {
			$(this).removeClass('active');
		});
	}

	$('.phone-mask').mask('+7 (999) 999-99-99');

	$('.phone-mask').on('focus', function () {
		$(this).attr('placeholder', '+7 (___) ___-__-__')
	});

	$('body').on('click', '.select-input', function() {
		$('.select-input').not(this).removeClass('active')
		$(this).toggleClass('active')
	});

	$('body').on('click', '.set-value', function() {
		var value = $(this).find('.select-value').text()
		var $parent = $(this).parent().parent()
		$parent.addClass('focus')
		$parent.find('input').val(value)
	});

    $('body').on('focus', '.form__input', function() {
    	if (!$(this).parent().hasClass('select-input')) {
        	$(this).parent().addClass('focus');
    	}
    });

    $('body').on('focusout', '.form__input', function() {
        if ($(this).val() == '') {
            $(this).parent().removeClass('focus');
        }
    });

    $('.popup-open').on('click', function() {
    	var popup = $('#'+$(this).attr('data-id'));
    	if (popup.find('video').length > 0) {
			popup.find('video').get(0).play();
    	} else if (popup.find('iframe').length > 0) {
		    popup.find('iframe')[0].contentWindow.postMessage('{"event":"command","func":"playVideo","args":""}', '*');
    	}
    	popup.fadeIn(300);
    });

    $('.popup-close').on('click', function() {
    	var popup = $('#'+$(this).attr('data-id'));
    	if (popup.find('video').length > 0) {
			popup.find('video').get(0).pause();
    	} else if (popup.find('iframe').length > 0) {
		    popup.find('iframe').get(0).contentWindow.postMessage('{"event":"command","func":"pauseVideo","args":""}', '*');
    	}
    	popup.fadeOut(300);
    });

	$(document).mouseup(function (e){
		var div_array = [
			'.select_wrap',
			'.header__lang-wrap',
			'.select-input'
		]
		for (var i = 0; div_array.length > i; i++) {
	    	var div = $(div_array[i]);
		    if (!div.is(e.target) && div.has(e.target).length === 0) {
		        div.removeClass('active');
		    }
		}

	});

	if ($('#calculator').length > 0) {
		var calculator = new Vue({
			el: '#calculator',
			data: {
			    childCount: 150,
			    price: 10000,
			    incomeUp: 25,
			    incomeUpPrice: 0,
				incomeUpChild: 0,
				incomeUpSum: 0,
				tweenedUpPrice: 0,
				tweenedUpChild: 0,
				tweenedUpSum: 0,
				showCheck: true
			},
			created: function() {
				window.addEventListener('scroll', this.handleScroll);
			},
			watch: {
				childCount: function(){
					this.childCount = this.childCount.replace(/\D/g,'')
				},
				price: function(){
					this.price = this.price.replace(/\D/g,'')
				},
				incomeUp: function(){
					this.incomeUp = this.incomeUp.replace(/\D/g,'')
				},
				incomeUpPrice: function(newValue){
					TweenLite.to(this.$data, 0.5, { 
						tweenedUpPrice: newValue 
					});
				},
				incomeUpChild: function(newValue){
					TweenLite.to(this.$data, 0.5, { 
						tweenedUpChild: newValue 
					});
				},
				incomeUpSum: function(newValue){
					TweenLite.to(this.$data, 0.5, { 
						tweenedUpSum: newValue 
					});
				}
			},
			computed: {
				animatedUpPrice: function() {
					return this.tweenedUpPrice.toFixed(0);
				},
				animatedUpChild: function() {
					return this.tweenedUpChild.toFixed(0);
				},
				animatedUpSum: function() {
					return this.tweenedUpSum.toFixed(0);
				}
			},
			methods: {
			  	calculate: function() {
			  		if (this.childCount && this.price && this.incomeUp) {
			  			this.incomeUpPrice = Math.round((this.price * 1.1 - this.price) * (this.incomeUp / 100) * this.childCount * 12)
			  			this.incomeUpChild = Math.round(this.price * (this.incomeUp / 100) * 5 * 12)
			  			this.incomeUpSum = Math.round(this.incomeUpPrice + this.incomeUpChild)
			  		} else {
			  			this.incomeUpPrice = 0
						this.incomeUpChild = 0
						this.incomeUpSum = 0
			  		}
			  	},
				handleScroll: function(event) {
					var windowHeight = window.innerHeight;
					var countBlockTop = $(this.$refs.qwe).offset().top;
					if(this.showCheck && (countBlockTop < $(window).scrollTop() + windowHeight - $(this.$refs.qwe).outerHeight() / 2)) { 
						this.showCheck = false
						TweenLite.to(this.$data, 2, { 
							tweenedUpSum: 600000,
							tweenedUpPrice: 450000,
							tweenedUpChild: 150000
						});
					}
				}
			}
		});
	}
})();

(function(){
	var windowHeight = window.innerHeight;
	var show = true;
		
	$(window).scroll( function (){

		$('.spincrement-wrap').each(function () {

			var countBlockTop = $(this).offset().top;

			if(show && (countBlockTop < $(window).scrollTop() + windowHeight - $(this).outerHeight() / 2)) { 
				show = false;
				$(this).find('.spincrement').spincrement({
			    	'thousandSeparator': ' ',
			    	'duration': 3000
			    });
			}
		})
	})	
})();


$('.news-detail__slider').slick({
  infinite: true,
  slidesToShow: 3,
  slidesToScroll: 3,
  nextArrow: ".next-slick",
  prevArrow: ".prev-slick",
  responsive: [
    {
      breakpoint: 1000,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2
      }
    },
    {
      breakpoint: 768,
      settings: {
        slidesToScroll: 1,
        slidesToShow: 1
       
      }
    }
  ]
});
	


(function() {
	$('#slick-slider').slick({
		swipe:true,
		prevArrow: '.slider_arrow-prev',
		nextArrow: '.slider_arrow-next',
		adaptiveHeight: true
	});

	$('.slider-btn').on('click', function() {
		var index = $(this).attr('data-index');
		$('#slick-slider').slick('slickGoTo', index, false);
		$('.slider-btn').removeClass('active')
		$(this).addClass('active');
	});


	var $slickElement = $('#slick-slider');
	$slickElement.on('init reInit beforeChange', function(event, slick, currentSlide, nextSlide) {
		$('.slider-btn').removeClass('active')
		$('.slider-btn[data-index='+nextSlide+']').addClass('active');
    });

})();










